import web3 from './web3';
import Poll from './build/Poll.json';

const instance = new web3.eth.Contract(
    JSON.parse(Poll.interface),
    '0x2fc9B197E66bE1ccBf3897f6a40BaA64BD07EC24'
);

export default instance;
